import React from "react";

const AddBtn = () => {
  return (
    <div className='fixed-action-btn'>
      <a className='btn-floating btn-large blue darken-2'>
        <i className='large material-icons'>menu</i>
      </a>
      <ul>
        <li>
          <a class='btn-floating yellow darken-1'>
            <i class='material-icons' style={chevronUp}>
              chevron_left
            </i>
          </a>
        </li>
        <li>
          <a class='btn-floating yellow darken-1'>
            <i class='material-icons' style={chevronDown}>
              chevron_left
            </i>
          </a>
        </li>
        <li>
          <a
            href='#add-company-modal'
            className='btn-floating red modal-trigger'>
            <i className='large material-icons'>add</i>
          </a>
        </li>
        <li>
          <a class='blue btn-floating modal-trigger' href='#status-modal'>
            <i className='large material-icons'>info</i>
          </a>
        </li>
      </ul>
    </div>
  );
};

const chevronUp = {
  transform: "rotate(90deg)",
};

const chevronDown = {
  transform: "rotate(-90deg)",
};

export default AddBtn;
